insert into dbo.Project([ProjectName], [OrganizationID], [StormwaterJurisdictionID], [ProjectStatusID], [PrimaryContactPersonID], [CreatePersonID], [DateCreated], [ProjectDescription], [AdditionalContactInformation], [DoesNotIncludeTreatmentBMPs])
