from #projectForExport

insert into dbo.TreatmentBMP([TreatmentBMPName], [TreatmentBMPTypeID], [LocationPoint], [StormwaterJurisdictionID], [Notes], [SystemOfRecordID], [YearBuilt], [OwnerOrganizationID], [WaterQualityManagementPlanID], [TreatmentBMPLifespanTypeID], [TreatmentBMPLifespanEndDate], [RequiredFieldVisitsPerYear], [RequiredPostStormFieldVisitsPerYear], [InventoryIsVerified], [DateOfLastInventoryVerification], [InventoryVerifiedByPersonID], [InventoryLastChangedDate], [TrashCaptureStatusTypeID], [SizingBasisTypeID], [TrashCaptureEffectiveness], [LocationPoint4326], [WatershedID], [ModelBasinID], [PrecipitationZoneID], [UpstreamBMPID], [RegionalSubbasinID], [ProjectID])
select [TreatmentBMPName], [TreatmentBMPTypeID], [LocationPoint], tfe.[StormwaterJurisdictionID], [Notes], [SystemOfRecordID], [YearBuilt], [OwnerOrganizationID], [WaterQualityManagementPlanID], [TreatmentBMPLifespanTypeID], [TreatmentBMPLifespanEndDate], [RequiredFieldVisitsPerYear], [RequiredPostStormFieldVisitsPerYear], [InventoryIsVerified], [DateOfLastInventoryVerification], [InventoryVerifiedByPersonID], [InventoryLastChangedDate], [TrashCaptureStatusTypeID], [SizingBasisTypeID], [TrashCaptureEffectiveness], [LocationPoint4326], [WatershedID], [ModelBasinID], [PrecipitationZoneID], [UpstreamBMPID], [RegionalSubbasinID], p.[ProjectID]
from #treatmentBMPForExport tfe
join #projectForExport pfe on tfe.ProjectID = pfe.ProjectID
join dbo.Project p on pfe.ProjectName = p.ProjectName

insert into dbo.TreatmentBMPModelingAttribute([TreatmentBMPID]
      ,[UpstreamTreatmentBMPID]
      ,[AverageDivertedFlowrate]
      ,[AverageTreatmentFlowrate]
      ,[DesignDryWeatherTreatmentCapacity]
      ,[DesignLowFlowDiversionCapacity]
      ,[DesignMediaFiltrationRate]
      ,[DesignResidenceTimeforPermanentPool]
      ,[DiversionRate]
      ,[DrawdownTimeforWQDetentionVolume]
      ,[EffectiveFootprint]
      ,[EffectiveRetentionDepth]
      ,[InfiltrationDischargeRate]
      ,[InfiltrationSurfaceArea]
      ,[MediaBedFootprint]
      ,[PermanentPoolorWetlandVolume]
      ,[RoutingConfigurationID]
      ,[StorageVolumeBelowLowestOutletElevation]
      ,[SummerHarvestedWaterDemand]
      ,[TimeOfConcentrationID]
      ,[DrawdownTimeForDetentionVolume]
      ,[TotalEffectiveBMPVolume]
      ,[TotalEffectiveDrywellBMPVolume]
      ,[TreatmentRate]
      ,[UnderlyingHydrologicSoilGroupID]
      ,[UnderlyingInfiltrationRate]
      ,[WaterQualityDetentionVolume]
      ,[WettedFootprint]
      ,[WinterHarvestedWaterDemand]
      ,[MonthsOfOperationID]
      ,[DryWeatherFlowOverrideID])
select t.[TreatmentBMPID]
      ,[UpstreamTreatmentBMPID]
      ,[AverageDivertedFlowrate]
      ,[AverageTreatmentFlowrate]
      ,[DesignDryWeatherTreatmentCapacity]
      ,[DesignLowFlowDiversionCapacity]
      ,[DesignMediaFiltrationRate]
      ,[DesignResidenceTimeforPermanentPool]
      ,[DiversionRate]
      ,[DrawdownTimeforWQDetentionVolume]
      ,[EffectiveFootprint]
      ,[EffectiveRetentionDepth]
      ,[InfiltrationDischargeRate]
      ,[InfiltrationSurfaceArea]
      ,[MediaBedFootprint]
      ,[PermanentPoolorWetlandVolume]
      ,[RoutingConfigurationID]
      ,[StorageVolumeBelowLowestOutletElevation]
      ,[SummerHarvestedWaterDemand]
      ,[TimeOfConcentrationID]
      ,[DrawdownTimeForDetentionVolume]
      ,[TotalEffectiveBMPVolume]
      ,[TotalEffectiveDrywellBMPVolume]
      ,[TreatmentRate]
      ,[UnderlyingHydrologicSoilGroupID]
      ,[UnderlyingInfiltrationRate]
      ,[WaterQualityDetentionVolume]
      ,[WettedFootprint]
      ,[WinterHarvestedWaterDemand]
      ,[MonthsOfOperationID]
      ,[DryWeatherFlowOverrideID]
from #treatmentBMPModelingAttributeForExport tmafe
join #treatmentBMPForExport tfe on tmafe.TreatmentBMPID = tfe.TreatmentBMPID
join dbo.TreatmentBMP t on tfe.LocationPoint.STAsText() = t.LocationPoint.STAsText() and tfe.TreatmentBMPName = t.TreatmentBMPName


insert into dbo.Delineation([DelineationGeometry], [DelineationTypeID], [IsVerified], [DateLastVerified], [VerifiedByPersonID], [TreatmentBMPID], [DateLastModified], [DelineationGeometry4326], [HasDiscrepancies])
select [DelineationGeometry], [DelineationTypeID], [IsVerified], [DateLastVerified], [VerifiedByPersonID], t.[TreatmentBMPID], [DateLastModified], [DelineationGeometry4326], [HasDiscrepancies]
from #delineationForExport dfe
join #treatmentBMPForExport tfe on dfe.TreatmentBMPID = tfe.TreatmentBMPID
join dbo.TreatmentBMP t on tfe.LocationPoint.STAsText() = t.LocationPoint.STAsText() and tfe.TreatmentBMPName = t.TreatmentBMPName

drop table #delineationForExport
